import banff

import os

def get_native_formats(files = [], sort_by=None):
    for f in files:
        fn = os.path.splitext(f)[0] # get extensionless filename
        foo = banff.io_util.type_converters.DF_from_sas_file(f)
        if sort_by is not None:
            try:
                foo = foo.sort_values(by=sort_by)
            except:
                pass
        banff.io_util.type_converters.DF_to_feather_file(foo, f"{fn}_unsorted.feather")
        banff.io_util.type_converters.DF_to_parq_file(foo, f"{fn}_unsorted.parquet")

for run in run_specs:
    print(f"SA_RUN: block {run['block_num']}, run {run['run']}")
    get_native_formats(
        files=[
            f"indata_{run['block_num']}_{run['run']}.sas7bdat",
            f"instatus_{run['block_num']}_{run['run']}.sas7bdat",
        ],
        #sort_by=run['by'].split(' '),
    )